import {NavigationItem} from '../index'
import './stytle.scss'
import {useState} from "react";
import {INavigationType} from '../../type'
// import HomeIco from '../img/home.svg'



const NavigationList = () => {


    const currentNavigationType: INavigationType[] = [{
        id:'transport', value:'Transport', img:'', active:true},
        {id:'real_estate', value:'Real Estate', img:'', active:false},
        {id:'technics', value:'Technics', img:'', active:false},
        {id:'cloth', value:'Cloth', img:'', active:false},
        {id:'appliances', value:'Appliances', img:'', active:false},]

    const [data, setData] = useState(currentNavigationType)

  return(
      <div className="batman-store__header-container_navigation">
          <ul className='batman-store__header-container_navigation-list'>

              {data?.map((item:INavigationType) => <NavigationItem key={item?.id} item={item}/>)}

          </ul>
      </div>
  )
}

export default NavigationList
